import { useEffect, useState } from "react";
import api from "../services/api";

const StudentDashboard = () => {
  const [docs, setDocs] = useState([]);

  useEffect(() => {
    api.get("/docs/my").then((res) => setDocs(res.data));
  }, []);

  return (
    <div className="p-6">
      <h2 className="text-xl font-bold mb-4">My Documents</h2>

      {docs.map((d) => (
        <div key={d._id} className="border p-3 mb-2">
          <p>Semester: {d.semester}</p>
          <p>Status: {d.status}</p>
          <a href={d.fileUrl} className="text-blue-600">
            Download
          </a>
        </div>
      ))}
    </div>
  );
};

export default StudentDashboard;
